import React, { useState, useEffect } from 'react';
import axios from 'axios';
import '../assets/cctv.css';

const App = () => {
  const [apiData, setApiData] = useState(null);
  const [hoveredIP, setHoveredIP] = useState(null); // State to store the hovered IP

  // Fetch API data
  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await axios.get(process.env.REACT_APP_HOST + '/api/ping/check-cctv');
        setApiData(response.data);
      } catch (error) {
        console.error('Error fetching data:', error);
      }
    };

    fetchData();

    const intervalId = setInterval(fetchData, 2000); // Refresh every 2 seconds

    return () => clearInterval(intervalId); // Cleanup interval on unmount

  }, []);

  return (
    <div className="table-container">
      <img src={require('../assets/jastel.jpg')} alt="Jastel Logo" />
      <table className="table">
        <thead className='TTH'>
          <tr>
            {apiData && apiData.data.map(room => (
              room.roomname !== "SLG" &&
              room.roomname !== "HYI3" &&
              room.roomname !== "HYI4" &&
              room.roomname !== "OFFICE7" &&
              room.roomname !== "OFFICE6" &&
              <th key={room.roomname} className="room-name1">{room.roomname && room.roomname}</th>
            ))}
          </tr>
        </thead>
        <tbody>
          <tr className='bb'>
            {apiData && apiData.data.map(room => (
              room.roomname !== "SLG" &&
              room.roomname !== "HYI3" &&
              room.roomname !== "HYI4" &&
              room.roomname !== "OFFICE7" &&
              room.roomname !== "OFFICE6" &&
              <td key={room.roomname}>
                <table className="table">
                  <tbody>
                    {room.status.split(',').map((item, index) => (
                      <tr key={index}>
                        {item.split(',').map((subItem, subIndex) => (
                          <td
                            key={subIndex}
                            className={`status-cell ${subItem.trim() === 'ON' ? 'status-on' : 'status-off'}`}
                            onMouseEnter={() => setHoveredIP(room.ipAddresses[subIndex])}
                            onMouseLeave={() => setHoveredIP(null)}
                          >
                            <div>{subItem.trim()}</div>
                          </td>
                        ))}
                      </tr>
                    ))}
                  </tbody>
                </table>
                {hoveredIP && <div>{hoveredIP}</div>} {/* Display IP address */}
              </td>
            ))}
          </tr>
        </tbody>
      </table>

      <table className='ST'>
        <tbody>
          {apiData && apiData.data
            .filter(room => ["SLG", "HYI3","HYI4", "OFFICE7", "OFFICE6"].includes(room.roomname))
            .map(room => (
              <tr key={room.roomname}>
                <td className="room-name2">{room.roomname}</td>
                <td className="room-status">
                  <table className="status-table">
                    <tbody>
                      <tr>
                        {room.status.split(',').map((item, index) => (
                          <td
                            key={index}
                            className={`status-cell ${item.trim() === 'ON' ? 'status-on' : 'status-off'}`}
                            onMouseEnter={() => setHoveredIP(room.ipAddresses[index])}
                            onMouseLeave={() => setHoveredIP(null)}
                          >
                            <div>{item.trim()}</div>
                          </td>
                        ))}
                      </tr>
                    </tbody>
                  </table>
                  {hoveredIP && <div>{hoveredIP}</div>} {/* Display IP address */}
                </td>
              </tr>
            ))}
        </tbody>
      </table>
    </div>
  );
};

export default App;
